import Profile from './Profile/Profile';
import img  from "./img.jpg";


function App() {
  return (
    <div className="App">
      <h1>My Profile</h1>
      <Profile fullName={fullN} bio ={bio} profession={profession} children={img}
       handleName={handleName} />
      
      
    </div>
  );
}

export default App;
